import React from 'react';

function Services() {
  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1>Our Services</h1>
      <p>We offer the following:</p>
      <ul>
        <li>Web Development</li>
        <li>App Development</li>
      </ul>
    </div>
  );
}

export default Services;
